import { get, post, put, deleted } from "../base/fetch";
import { usePaginate } from "../base/paginate";
import { Resident } from "./model";

export const create = async (resident: Resident) => {
  const res = await post<Resident>("/api/resident");
  return res;
};

export const update = async (resident: Resident) => {
  const res = await put<Resident>(
    `/api/resident/${resident.id}`,
    JSON.stringify(resident)
  );
  return res;
};

export const image = async (image: any) => {
  const res = await (await post<Resident>("api/resident/image")).body({image});
}

export const destroy = async (id: number) => {
  const res = await deleted(`/api/resident/${id}`);
  return res;
};

export const useResidentsList = () => {
  return usePaginate<Resident>("/api/resident/");
};

export const getResident = async (id: number) => {
  const res = await get(`/api/resident/ + ${JSON.stringify(id)}`);
  return res;
};
